import React from 'react';

const Credits = props => {
    return (
        <div className="credits">
            <a href="https://www.freepik.com/free-vector/hand-drawn-robot-character-collection_1618832.htm">Designed by Freepik</a>
        </div>
    )
}

export default Credits;
